import "./App.css";
import Mainboard from "./Components/Mainboard";
import Sidebar from "./Components/Sidebar";
import Appointment from "./Components/Appointment";
import { useState, createContext } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

export const Sidebarinfo = createContext();

function App() {
  const randevuekle = "Randevu Ekle";

  const [hidesidebar, setHidesidebar] = useState(false);
  const encodedrandevuekle = encodeURIComponent(randevuekle);

  return (
    <Router>
      <div className="App">
        <Sidebarinfo.Provider value={{ hidesidebar, setHidesidebar }}>
          <Sidebar></Sidebar>
          <Routes>
            <Route path={`${encodedrandevuekle}/0`} element={<Appointment />} />
          </Routes>
        </Sidebarinfo.Provider>
      </div>
    </Router>
  );
}

export default App;
